DROP TABLE IF EXISTS `model_runs`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `model_runs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `algorithm` varchar(50) NOT NULL DEFAULT 'C4.5',
  `accuracy` decimal(5,4) NOT NULL,
  `precision` decimal(5,4) NOT NULL,
  `recall` decimal(5,4) NOT NULL,
  `f1_score` decimal(5,4) NOT NULL,
  `tree_structure` longtext NOT NULL,
  `confusion_matrix` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`confusion_matrix`)),
  `rules_count` int(11) DEFAULT 0,
  `training_samples` int(11) NOT NULL,
  `test_samples` int(11) NOT NULL,
  `training_time_ms` int(11) DEFAULT 0,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `idx_algorithm` (`algorithm`),
  KEY `idx_accuracy` (`accuracy`),
  KEY `idx_created_at` (`created_at`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
